    y_pos <= CONV_INTEGER(Y - 24) when (23 < Y) and (Y < 171) else -1;
    x_pos <= CONV_INTEGER(X) when X < 288 else -1;
    addr  <= (y_pos * 288) + x_pos when 0 < y_pos and 0 < x_pos else -1;

end RTL;
